import { createApp } from 'vue';
import App from './App.vue';
import { data, text2 } from './data1';
import aalleerrtt from './data2';

//createApp(App).mount('#app');
new Vue ({
  render: h => h(App),
}).mount('#app');

aalleerrtt(data.text1);
aalleerrtt(text2);
